import React from 'react';
import Question from './Question';
import Button from '@material-ui/core/Button';

const questionsList = [
  {
    questionId: 1,
    questionText: 'A',
    answersOptions: ['1', '2', '3', '4']
  },
  {
    questionId: 2,
    questionText: 'B',
    answersOptions: ['1', '2', '3', '4']
  },
  {
    questionId: 3,
    questionText: 'C',
    answersOptions: ['1', '2', '3', '4']
  },
  {
    questionId: 4,
    questionText: 'D',
    answersOptions: ['1', '2', '3', '4']
  },
];

clientReturned = clt => {
    this.setState({ client: clt });
  };

class App extends React.Component {

  render(){
  return (
    <div className="App">

      <Question questionDetail={questionsList[0]}></Question>

      <Button variant="contained" color="secondary" >
        Prev
      </Button>

      <Button variant="contained" color="primary" >
        Next
      </Button>

    </div>
  );
  }
}

export default App;
